import React from "react";
import ExpenseItem from "./components/ExpenseItem";

const App = () => {
  const expense = [
    {
      title: 'Car Insurance',
      amount: 299.00,
      date: new Date(2021, 20, 22)
    },
    {
      title: 'Buy Macbook',
      amount: 599.00,
      date: new Date(2021, 20, 25)
    },
    {
      title: 'Buy PS5',
      amount: 220.00,
      date: new Date(2021, 20, 10)
    },
  ]
  return (
    <div>
      <h1>Lets Get Started</h1>
      <ExpenseItem />
    </div>
  );
};

export default App;
